import React, { useState } from 'react';
import { RiMenu3Line, RiCloseLine } from 'react-icons/ri'
import logo from '../../assets/logo.jpg';
import './navbar.css';

const Menu = () => (
  <>
    <p><a href='#home'>Обо мне</a></p>
    <p><a href='#wgpt3'>Тренировки</a></p>
    <p><a href='#possibility'>Цены</a></p>
    <p><a href='#features'>Обратная связь</a></p>
  </>
)

function Navbar() {
    return (
        <div className="navbar">
            <div className="left-menu">
                {/* Здесь содержится ваше левое меню */}
            </div>
            <div className="center-logo">
                {/* Здесь содержится ваш логотип или эмблема */}
                <img src="path_to_logo" alt="Logo" />
            </div>
            <div className="right-menu">
                {/* Здесь содержится ваше правое меню */}
            </div>
        </div>
    );
}

export default Navbar;
